import React, { useEffect } from 'react'
import { Navigate } from 'react-router-dom';

function AddResultSubmit() {
    useEffect(()=>{
        setTimeout(() => {
            Navigate('/')
        }, 1000);
    },[])
  return (
    <div>
        <h1>Thank you !</h1>
    </div>
  )
}

export default AddResultSubmit
